2	4	Dr. Kumarappa S.	Examination	drskumarappa@gmail.com	+919341000364	about_biet/deans/image/T-ME-02-Dr_S_KUMARAPPA.jpg	It is with immense pleasure I welcome the young minds, the future of knowledgeable society, to Bapuji Institute of Engineering and Technology, an institution focused on imparting value based education integrated with academic education par excellence.\r\nOur Institute becomes more and more responsive to the ever-changing needs of the students and the engineering profession. Students in BIET mean more than simply preparing for an exam or career; strive to produce manpower who can contribute to the growth of nation. Institute offers not only academic pursuits but a wide range of social, cultural and recreation activities. Our Institute vision is to become the center of excellence. It is true that quality is achieved only with creating excellence in work, work environment, human resources, etc.\r\nThe various programs have grown significantly with each subsequent semester where examination is an important and essential phase. To express one’s knowledge of subject by various methods of examinations such as the assessment through class room participations, term papers, class tests, tutorials, group discussion, etc. Along with this it is also important for student to exhibit good study habits, cooperative attitude, attentive and hardworking habits, logical and rational thinking and open-mindedness. Our students are not only future alumni, but they will take the knowledge and vision of excellence gained from here to manifest as their own, which will have a unique impact on society. We are proud of the progress of our students and in future shall continue to provide knowledge, skills and competencies specifically required in the field of higher education.\r\nFor any official examination related circulars/notifications I advice the students to visit www.vtu.ac.in and also college notice board only.\r\nI take this opportunity to extend my heartiest wishes to all the students to achieve success in campus and future career initiatives.	about_biet/deans/data/dean_exam.pdf
1	5	Dr. S. Suresh	Student Welfare	drssubiet@gmail.com	+919448233199	about_biet/deans/image/Dr.Suresh_S_B2g0vmF.jpg	In the modern days of highest competition one has to develop a complete competency in different fields. Involving in sports and cultural activities will not only help the students to overcome the stress due to heavy academic schedules, but will also surely boost physical health of students. Keeping this in view, Students’ Council of our institute plans variety of activities every year so that students can exhibit their hidden talents and improve upon their abilities. Mega cultural fest Davana, annual sports meet, conference, etc. are regularly arranged by the Students’ Council. Activities of the Students’ Council are planned and executed by the students only. This will help them to develop organizational skills. Our students will also be encouraged to participate in different activities organized by different institutes and Universities. My dear aspirants of technical education, I extend a warm welcome to all of you to join hands with us to learn all under one roof.	about_biet/deans/data/students_council.pdf
11	10	Dr. Poornima B	Incubation	poornimateju@gmail.com	+919844756458	about_biet/deans/image/Dr.BP_kNPGKsY.jpg	Innovation in BIET is given an utmost importance and is regarded as one of the most important activities besides teaching and learning. The institution with well-built infrastructure, dedicated & qualified faculty, moderate research facilities and supportive management provides an excellent ambience for entrepreneurship. Innovation circles, mentored by Dean – Innovation Cell, senior faculty members are active and are primarily responsible for cultivating entrepreneurship culture in students and faculty. Currently, BIET has an active program called New Age Innovation Network (NAIN) supported by KITS, Dept. of IT, BT, Science & Technology, Govt. of Karnataka. The college encourages students to take technical entrepreneurship with innovative ideas resulting in solutions for the welfare of the society.\r\nI wish all the Innovators the best in their upcoming endeavours\r\n\r\nDr. Poornima B.\r\nDean – Innovation Cell	about_biet/deans/data/Untitled_document_1.pdf
3	2	Dr. M. S. Nagaraja	Training  & Placement, Campus Connect  Program	msndvg@gmail.com	+919844484767	about_biet/deans/image/DR.M_SN_9H9ckQA.jpg	It gives me an immense pleasure to extend you a most cordial invitation to participate in the Campus Recruitment Programme of the Bapuji Institute of Engineering & Technology, Davanagere. With an increasing thrust being placed on Institute-Industry Interaction, it is my sincere belief that your esteemed organization and Bapuji Institute of Engineering & Technology, Davanagere, will stand to gain immensely from this symbiotic relationship. Our college is the most preferred academic Institute to a large number of organizations for recruiting outstanding employees with the potential for being their future leaders. These organizations are excited about the capability, skill, intellect and the professional readiness displayed by our students. With a meticulously designed recruitment process that has been improving year after year, we strive to provide our recruiters an experience that benefits our stature. We highly value our partnership with recruiters, alumni and remain committed to making your recruiting experience enjoyable and rewarding. I invite the recruiting organizations and graduating students to work on finding the best match between expectations of the recruiters and the aspirations of the students.	about_biet/deans/data/dean_placement.pdf
10	7	Dr. Leela.G.H	Admissions	leela_mahesh@rediffmail.com	+919844474712	about_biet/deans/image/T-EC-03-Dr_G_H_LEELA_U0apEdX.JPG	Being an Engineer is Prestigious and an Admired job title.\r\n\r\nEngineers are some of the highest-paid workers.  It takes a lot of hard work and effort to qualify as an engineer.   Engineers have Logical Thinking, Critical Analysis, Decision Making and Problem-Solving skills necessary to achieve Professional Success. They’re avid learners.\r\nEngineering contains a large number of job opportunities and specialties. It is an incredibly broad profession with exciting career that allows them to work  across the globe.\r\nEngineers contribute to society and the world around them in their everyday lives by providing solution to most of real life problems through technologies and other services.\r\n If you are an Engineering Aspirant, Bapuji Institute of Engineering and Technology is the final stop for your search.\r\n\r\nJoin BIET and fulfil your dream of becoming an Engineer.	about_biet/deans/data/admission.pdf
7	6	Dr. G.P. Desai	Public Relation Officer and Training and Placement	desai_gp@yahoo.com	+919845388943	about_biet/deans/image/Dr.Desai_dhVAyxp.jpg	In these present days of high competition, one has to have a very good\r\ncommunication skills in order to excel and convince people. When soft skills are\r\nmade part of the education system along with core courses, the trained students\r\nwill be equipped to take up any kind of assignments. BIET strongly believes this\r\nand ample of training in soft skills will be made available to all the students\r\nthrough its number of well-structured soft skill programs. I welcome all the\r\naspirants of engineering education to this temple of learning which molds you\r\nto have an outcome and need based education imbibed with necessary soft skill\r\ntraining.	about_biet/deans/data/Message_PR.pdf
6	1	Dr. K. Sadashivappa	Academic	skankuppi@gmail.com	+919241425736	about_biet/deans/image/Dr.Sadashivapa_ROYCeSG.jpg	BIET offers various undergraduate, post-graduate and doctoral programmes in Faculty of Engineering and Faculty of Management. The academics at BIET provide the students a strong background in fundamentals, an ability to translate it to real life problems, and capability to design, build and analyze different products, processes and systems.\r\nWe, the BIET, as a community  focus in delivering  high quality technical education  to the students through a blend of theoretical and practical sessions, industrial visits, internships, skill development programmes and hands on experiences with technologies to transform the students into an ethically driven competent professionals to serve the society and the nation. High quality education is offered through highly skilled, well experienced, dedicated faculties having academic and industrial experiences.	about_biet/deans/data/Dean_academic_message.pdf
8	11	Dr. Nirmala C.R	IT Cell, & Foreign University Interaction	nirmala.cr@gmail.com	+919740770377	about_biet/deans/image/T-CS-02-Dr_NIRMALA_C_R_PKDxn4i.jpg	Dear all,\r\nGreetings fromDean IT Cell.\r\nThis cell is a first of a kind cell constituted in the institute after 40 years of its inception. I am really grateful to the higher authorities who identified me as Dean IT Cell. The main function of the cell is to provide the complete digital look to the institute with office automation.\r\n IT cell is responsible for  Coordinating the acquisition and/or procurement, installation, inventory, and maintenance of computer/audio-video and telecommunications hardware and software, for use in instruction, student services, and administration, at  on-campus sites. It involves working with other deans and HOD’s  when necessary, planning for the coordination, organization, and operation of the college’s computer, media, and online educational program and instructional computing laboratories, ensuring effective service to faculty, staff, and students. IT cell is also responsible for  developing and maintaining an IT resource inventory, and developing policies and procedures to provide efficient and effective use of computing resources.  IT cell  will be coordinating, developing, implementing, and updating the college’s technology plan, which includes policies, procedures, and standards for the procurement and use of computer, telecommunications, and media services.   IT cell can provide IT support for the internet activities of the college, including administrative services, student services, and instruction websites and  also Providing leadership and IT support for instructional and student services efforts for all student tracking programs, internet activities, and online education.	about_biet/deans/data/ROLES_AND_RESPONSIBILITIES_OF_DEAN_IT_CELL.pdf
5	8	Smt. Ashalatha M.E	Women Welfare	meashalatha@rediffmail.com	+919844638188	about_biet/deans/image/Prof.MEA_2MTd0EJ.jpg	The objective of BIET Women Welfare Cell is to strengthen women in the view of self-growth, education, provide the support for improvement of social competitiveness, and create a healthy working environment to enhance professional and individual development.\r\n\r\nInstitution is committed to impart quality education along with ethical and moral values. Women need to be empowered through the strongest tool – education. The BIET Women Welfare Cell strives to create an atmosphere conducive to gain knowledge and acquire skills by organizing seminars, invited talks and various awareness programs which help students to enhance their career in a broad spectrum. \r\n\r\nOn March 8 every year, International Women's Day is celebrated in the campus. Faculty and students are felicitated for their achievements. Various events and competitions are hosted at the institute level on this occasion. \r\n\r\nThe institution has constituted a College Internal Complaint Committee (CICC) represented by staff, students of our institute and an external member. BIET Women Welfare Cell works in coordination with CICC.	about_biet/deans/data/women.pdf
9	9	Dr. Pradeep N	Alumni Relations	nmnpradeep@gmail.com	+919886086840	about_biet/deans/image/T-CS-05-Dr_PRADEEP_N_mnJ5Fmk.JPG	Bapuji Institute of Engineering and Technology has become an institution of iconic marvel in academics and research and accredited with "A" grade by NAAC. \r\nRecognised by All India Council of Technical Education, New Delhi and affiliated to Visvesvaraya Technological University, Belagavi, Karnataka. The institution endeavours to provide broad based education and assistance for its students so that they may move towards the fulfilment of their dreams and aspirations. Since from its inception, institute has produced graduates, post graduates and doctorates in diverse disciplines, who have remarkably contributed in their respective fields and are now a part of our Alumni Association. Alumni members are spread across the world; the college alumni association remain connected with their alma mater as well as their friends/contemporaries through the association activities. The institution cherishes its alumni, as not only they are role models for the coming generations but also ambassadors for promoting the Institute’s Vision and Mission. The association is committed to establish, foster and nurture a strong bond between the alumni and the institution for achieving excellence and reaching newer heights. The alumni association members are committed to develop a strong relationship between the alumni and the Institution and to develop different platforms for achieving excellence at the Institute. \r\nIn each department, a separate alumni coordinator has been identified and they are the key person for building association with the alumni. Departments regularly organizes alumni meets at the department level.\r\nThe Alumni Association ensures and facilitates interactions between alumni and the current students by providing forums and creating opportunities for interactions. \r\nThe Alumni Association strongly encourages its members to collaborate with the institution, stay in touch with its members and give valuable suggestions for the development and upliftment of their alma mater. \r\nThe institute also welcomes suggestions from the alumni for its academic growth.	about_biet/deans/data/message_1.pdf
4	3	Dr.  A.G. Shankara Murthy	Research & Development (R & D)	agsiitr@gmail.com	+919448240355	about_biet/deans/image/T-ME-06-Dr_SHANKARA_MURTHY_A_G.jpg	Thank you for visiting R&D page of our website. Research activities at Bapuji Institute of Engineering and Technology (BIET) has grown significantly in the recent past. Financial support and the number of research publications, books and course materials authored by our team have doubled in the past four years.  Institute faculty have received research grants from the various funding agencies like AICTE, DST, DBT, MoEF, CSIR, KSCST, SDC, VGST-Govt of Karnataka, and some reputed industries. So far, Karnataka State Council for Science and Technology has sanctioned more than 640 student projects since 1983.  Our faculty provides consultancy services to individuals, industry and government organizations across the state. Collaborations with leading science and technology organizations, Universities and industry nurtured by the Institute provides the intensity required for meaningful research. R&D center is equipped with high end equipment’s, facilities and computing platforms. Healthy research atmosphere of the campus attracts generation of concepts, ideas and technologies. To facilitate our research vision BIET provides research support and promises conducive environment to staff and Doctoral students. We invite prospective students and faculty to explore a research career at BIET Research center.\r\n\r\nDr. A.G. Shankara Murthy\r\nResearch & Development (R & D)\r\nagsiitr@gmail.com\r\n\r\n+919448240355	about_biet/deans/data/Dean_message.pdf
