-- Data for Name: campus_life_sac_intro_text; Type: TABLE DATA; Schema: public; Owner: bietda
--

COPY public.campus_life_sac_intro_text (id, text) FROM stdin;
1	In the present day of high competition one has to have a very good communication and soft skills along with curriculum inputs. BIET believes in overall development of its students who can adopt in any kind of environment and succeed. Keeping this in view “Students’ Academic Council” has been formed in the institute and has been very active since 1984. Many activities are arranged by Students’ Academic Council which will help students to exhibit the different talents and improve upon soft skills. Activities of the council are totally managed by the students. All the students of the institute will elect their class representatives and who in turn elect the executive council of the Students’ Council. There will be four staff conveners who will guide the students for conducting various activities. Every year an Ethnic Day will be arranged in which students will exhibit the cultures of different parts of our country. Fashion show provides students an opportunity to exhibit the creative talents. A paper presentation competition will help students in improving the communication and demonstration skills. Regular sports activities are conducted which will provide students ample opportunities for improving sports talents. A multi gym is also managed by students’ council. Annual mega cultural festival “DAVANA” is a very big cultural bonanza which creates a platform for exhibiting various cultural talents.  Students’ Council also encourages students to participate in various activities conducted by Visvesvaraya Technological University and many other institutes in different parts of the country. Students’ Academic Council extends a warm welcome to all engineering education aspirants to join hands with us for creating a bright future.
\.


