3	Amulya Shastry	Bioinformatics Scientist at the National Institutes of health	Amulya Shastry, is an alumni of Dept. of Biotechnology, Bapuji Institute of Engineering and Technology, Davangere of the batch 2011-2015. Amulya  Shastry recently graduated from North-eastern University with a master’s degree in Bioinformatics.I am delighted to inform you that I have secured a position as a Bioinformatics Scientist at the National Institutes of health. I will be working for the microbiome core at the NIAID. I wanted to thank you and all the professors of the biotechnology department for the immense support and guidance. This would not have been possible without your constant effort towards the betterment of biotech department which gave me an opportunity to mend my skills.	department/alumni/BT/amulya_1efXKnz.png	5
1	Dr. Ashish A Prabhu	Assistant Professor,Department of Biotechnology National Institute of Technology, Warangal , Telangana, India	Dr. Ashish Prabhu, an alumni of Dept. of Biotechnology, Bapuji Institute of Engineering and Technology, Davangere of the batch 2007-2011, Visvesvaraya Technological University and Masters degree in Industrial biotechnology from Manipal Institute of Technology, India. During his masters he worked on the project entitled “Bioprocessing of rice bran as a functional food ingredient” at Central Food Technological Research Institute Mysore, India. He secured top ranking in his post-graduation and bagged a gold medal. Besides, he also qualified GATE (Graduate Aptitude Test for Engineering) with 91 Percentile in biotechnology division. Ashish obtained his PhD (Biochemical Engineering) in 2018 from the Department of biosciences and bioengineering, Indian Institute of Technology, Guwahati.  His doctoral research primarily focused on engineering methylotrophic yeast Pichia pastoris and optimizes the process in shake flask as well as reactor scale to produce a high titer of human interferon gamma. Subsequently, he also worked on engineering of other GRAS (Generally Regarded as Safe) organisms such as Bacillus, K.lactis and E.coli for the production of therapeutic proteins/Enzymes. Post PhD he joined Tata Institute of Genetics and Society, Bangalore, India, where he worked on production of malarial antigen and Single chain antibody in E.coli and Insect cell lines. Later he joined as Research Fellow in Metabolic Engineering, Center for climate and environmental protection in Cranfield university, United Kingdom. Where he worked on engineering of oleaginous yeast Yarrowia lipolytica for the production of value added products such as xylitol and succinic acid using renewable carbon sources such as sugarcane bagasse hydrolysate and crude glycerol. Currently he is working as Assistant Professor in Department of Biotechnology, National Institute of Technology Warangal. \r\nDr Ashish has specialization in bioprocess and metabolic engineering of microbial cell factories for the production of biological products at high titer in reactor scale. He is interested in developing second generation biorefinery by utilizing renewable sources.  Currently his research focused on. Pathway manipulation of cell factories for sustainable growth and production on renewable carbon sources. Optimization of process parameters in bioreactor level for maximizing the productivity of platform chemical commodities. Developing the mathematical models to understand the genotype-phenotype relationship of cell factories. He has published 41 research articles in journals of international reputation and also has 7 book chapters.	department/alumni/BT/Ashish_EBXa8xU.png	3
