1	Association of Chemical Engineers (ACES), A forum of Chemical Engineers, Department of Chemical Engineering, BIET, was established in the year 1997 under the stewardship of Dr. S.S. Hotanahalli, the then HOD, Chemical Engineering. Head of Department will be the president of ACES and staff and students will be the members of Association. Since its inception, the ACES conduct Student centric activities under the guidance of department head and staff members. One staff member will be the Treasurer of ACES. There will be student members like General Secretary, Cultural Secretary, Treasurer to run the office of ACES. The association will conduct the activities like Inauguration of Forum, Welcome to Freshers to the department, Farewell to outgoing students, Teacher’s day Celebration etc. ACES also conducts CHEMEXCEL, A National Level Students’ Symposium every year. On behalf of association industrial visits, Guest Lectures, Cultural Events, Sports Events, Workshops, etc., were organized frequently.
