 for Two Academic Years. \r\nShe has worked as resource person for Indira Gandhi National Open University study center, Bapuji Hi-Tech College for BCA, Facilitator for Infosys Initiated Campus connect program. She has delivered the lectures in Short Term Training Programs organized under ISTE Chapter and Workshops. She has attended seminars, workshops and short term training programme. She is a Life member of ISTE, FIETE & FIE.
