2	Department of Electronics & Communication Engineering have started students forum termed “ECFORUM” with the view to provide a platform to    showcase the students hidden talent in curricular, co-curricular and extra-curricular activities. ECFORUM aims at strengthening the academic background of   the students and strives hard on their overall exposure by conducting various Workshops and Exhibitions. Forum also arranges Technical talks by eminent personalities across various industries to bridge the gap between industry and institute. It helps the students to be in line with the current technology   and plays a major role in their overall development. ECFORUM also organizes "NB CUP" an intra-college Cricket tournament for boys and Throw Ball for Girls   to encourage sports. “E-Utsav” a Technical & Non-Technical fest organized every year. Under E-Utsav, events like Cognition, Funtronics, Treasure hunts,   Pic clicks, Cooking without fire and Barisu Kannada Dimdimava will be organized. Every year State level technical paper presentation “PAPYRUS” will be conducted under ECFORUM.
\.


