--

COPY public.department_information_science_dept_forum (id, description) FROM stdin;
1	Department of Information Science and Engineering has started its forum “INSYNC”with the view to advance the cause of technical education. The aim of the forum is to assist and contribute in the development of quality professional engineers required by the IT industries and other organizations. INYSNC aims at  strengthening the academic background of the students and strives hard on their overall exposure by conducting various workshops and exhibitions. Forum also arranges tech talks by eminent personalities across various industries to bridge the gap between industry and institute. It helps the students to be in line with the current technology and plays a major role in their overall development. INSYNC also organizes "Pro Kabaddi" during even semester to encourage sports, and an inter-collegiate technical & non-technical fest “INFOZEST” every year, which includes various events like Paper presentation & Poster presentation, Quiz, Mock press, Blind coding, Hack the box, Code Chef, Web designing and many more.
\.


