2	Innovative Teaching Methods\r\n•\tFaculty members provide quality study material to enrich students learning.\r\n•\tMode of teaching in this department is not only limited to the traditional chalk and talk methods but also an amalgamation of modern technology (Ex. Power point presentation, audio video teaching, demonstration of models etc.)\r\n•\tStudents are encouraged to visit NPTEL lecturers, browse different internet sites to increase their knowledge base about the subject. Moreover through these activities, students acquire relevant knowledge which is beyond the syllabus as per the university curriculum\r\n•\tMECH-I-PRIX a national level student technical symposium is regular important events arranged by the forum. The aim of event is to promote innovation, creativity, skills and talent in different areas. The fest provides an opportunity to the students across the country to participate in different events.\r\n•\tFaculty members arrange various learning programs like quiz, debate, seminars, Invited talks, symposiums, personality development & communication improvement programs etc., and encourage students to participate.\r\n•\tFaculty frequently arranges industrial visits to study of layouts, equipment’s, controls, working and functioning of industry to students expose the students to real world environment.\r\n•\tArranging interactive sessions for the students with industry experts.
