COPY public.department_mechanical_dept_forum (id, description) FROM stdin;
8	Mech-I Prix, National level technical event conducted every year by the department provides a platform for the students from national level technical institutes to exhibit their technical knowhow and multifaceted skills. Under this forum various technical, aptitude, Quiz and cultural events will be organised. Program will be sponsored by various professional bodies like ISTE student chapter, IEI India, leading industrialists, Alumni’s and national Banks. Cash Prizes will be awarded for the winners along with a certificate of honour/participation. Moreover students will be motivated by proud alumnus during the program to share their experience and opportunities for the Mechanical engineers in the leading industries. Department also invites distinguished experts from industry and academia from reputed organisations like NITs and IITs to share the upcoming technologies through their technical presentations. Department also conducts various soft skill, hard skill and personality development training programs to update their aptitude and technical skills to participate in recruitment drive/campus interview. Department also encourages students to participate in workshops, seminars, short term courses and visits to industries, research centre to update their knowledge in upcoming areas.
