6	Dr.K.Murugesh Babu	Professor and Head of the Department	department/TX/image/T-TX-01-Dr._K._Murugesh_Babu.jpg	department/TX/data/K_Murugesh_Babu_S44mC3y.pdf	1	HOD	Dr. K Murugesh Babu obtained his B.Tech (Textile Technology) degree in the year 1986 from BIET securing first class with distinction. He joined the same department as Lecturer in 1987. He pursued his higher studies at Anna University, Chennai and got his M.Tech (Textile technology) postgraduate degree in the year 1991. He obtained his Ph.D. from IIT Delhi in the year 2001.\r\nDr. K Murugesh Babu was invited by the scientists of Oxford University, UK to conduct research on Silk Based Biomaterials in the year 2006. He worked on this project at Oxford Biomaterials Ltd., a spin-off company of Oxford University, Newbury for a period of one year. During this period, Dr. K Murugesh Babu visited European countries such as Germany, France, Belgium, Switzerland, Luxemburg, Holland etc.\r\nAs a second phase of his international assignments, Dr. K Murugesh Babu was invited by professors of Hong Kong Polytechnic University, Hong Kong during 2007-2008 to carry out advanced research on Shape Memory textiles and garments. Dr. K Murugesh Babu was awarded with the prestigious “Commonwealth Fellowship” by the Association of Commonwealth Universities, UK in 2014. Under this fellowship he was invited as a Visiting Professor by the University of Maroua, Cameroon, Central Africa to establish and develop the Department of Textiles.\r\nDr. K Murugesh Babu has published over 100 research papers in various national and international textile and polymer related research journals. He has also contributed 10 Book Chapters in text books published from Wood Head Publishing House, Cambridge, an UK based international publishing house and his text book entitled Silk – “Processing, Properties and Applications” was published in 2011. The second edition of this book was published in 2019. He is also recognized as a Technical Referee for more than 10 international refereed textile/polymer journals. His name has been included in “World’s Who’s Who 2010 Edition”.\r\nDr. K Murugesh Babu is presently working as a Professor and Head at the Department of Textile Technology and Research Centre. He also served the institute as Dean (Public Relations) for 5 years. His main research areas include silk based biomaterials, natural fibre based eco-biocomposites, Eco-friendly processing, organic cotton processing and eco-management concepts, natural anti-microbial agent based finishing of cotton and other fibres, bamboo-blended fabric production & characterization etc.\r\nDr K Murugesh Babu is at present on a deputation to Soochow University, Suzhou, China on an advanced research assignment.
\.


